import org.junit.Test;

import java.util.HashMap;
import java.util.Map;

public class MinimumWindowSubstring {
	public String minWindow(String s, String t) {
		if (s.equals("") ||t.equals("")|| s.length() < t.length()) {
			return "";
		}
		int[] slow = new int[1];
		int[] fast = new int[1];
		Map<Character, Integer> dict = buildMap(t);
		printMap(dict);
		Map<Character, Integer> containWords = new HashMap<>();
		int[] uniqueChar = new int[1];
		int[] ans = new int[3];
		ans[0] = Integer.MAX_VALUE;
		ans[1] = -1;
		ans[2] = -1;
		while (fast[0] < s.length()) {
			char ch = s.charAt(fast[0]);
			if (dict.containsKey(ch)) {
				if (containWords.containsKey(ch)) {
					containWords.put(ch, containWords.get(ch) + 1);
				} else {
					containWords.put(ch, 1);
				}

				if ((int)containWords.get(ch) == (int)dict.get(ch)) {
					uniqueChar[0]++;
					if (uniqueChar[0] == dict.size()) {
						//update Ans and shrink until string from slow to fast does not contain all the words
						shrinkRange(slow, fast, uniqueChar, dict, containWords, ans, s);
					}
				}
			}
			fast[0]++;
		}
		if (ans[1] >= 0 && ans[2] >= 0) {
			return s.substring(ans[1], ans[2] + 1);
		} else {
			System.out.println("I am here");
			return "";
		}
	}

	private void printMap(Map<Character, Integer> dict) {
		for (Character c: dict.keySet()) {
			System.out.println(c + "  " + dict.get(c));
		}
	}

	private void shrinkRange(int[] slow,
							 int[] fast,
							 int[] uniqueChar,
							 Map<Character, Integer> dict,
							 Map<Character, Integer> containWords,
							 int[] ans,
							 String s) {
		while (uniqueChar[0] == dict.size() && slow[0] <= fast[0]) {
			updateAns(ans, slow, fast);
			char ch = s.charAt(slow[0]);
			slow[0]++;
			if (dict.containsKey(ch)) {
				containWords.put(ch, containWords.get(ch) - 1);
				if (containWords.get(ch) < dict.get(ch)) {
					uniqueChar[0]--;
				}
			}
		}
	}
	private void updateAns(int[] ans, int[] slow, int[] fast) {
		if (fast[0] - slow[0] < ans[0]) {
			ans[0] = fast[0] - slow[0] + 1;
			ans[1] = slow[0];
			ans[2] = fast[0];
		}
		System.out.println("length is " + ans[0]);
		System.out.println("slow is " + ans[1]);
		System.out.println("fast is " + ans[2]);
	}
	private Map<Character, Integer> buildMap(String t) {
		Map<Character, Integer> dict = new HashMap<>();
		int idx = 0;
		while (idx < t.length()) {
			char ch = t.charAt(idx);
			if (dict.containsKey(ch)) {
				dict.put(ch, dict.get(ch) + 1);
			} else {
				dict.put(ch, 1);
			}
			idx++;
		}
		return dict;
	}
	@Test
	private void test() {
		String s = "";
		String t = "";
		minWindow(s, t);
	}
}
